
def HammingDistance(first,second):
	hammingDist = 0
	for i in range(len(first)):
		if first[i] != second[i]:
			hammingDist += 1
		continue
	return hammingDist

def appPatternMatch(pattern,text,d):
	count = 0
	end = len(text) - len(pattern)
	patLength = len(pattern)
	array = []
	for i in range(end):
		match = text[i:i+patLength]
		if HammingDistance(pattern,match) <= d and i not in array:
			array.append(i)
	return array

pattern1 = 'CCCACACCT'
text2 = ''

result = appPatternMatch(pattern1,text2, 6)
print(" ".join(str(x) for x in result))
